INSERT INTO `privacy_policy` (`id`, `policy`, `date`) VALUES
(3, '<p>This privacy policy (&quot;Policy&quot;) describes how Website Operator (&quot;Website Operator&quot;, &quot;we&quot;, &quot;us&quot; or &quot;our&quot;) collects, protects and uses the personally identifiable information (&quot;Personal Information&quot;) you (&quot;User&quot;, &quot;you&quot; or &quot;your&quot;) may provide on the sahardirectory.com website and any of its products or services (collectively, &quot;Website&quot; or &quot;Services&quot;).</p>\r\n\r\n<p>It also describes the choices available to you regarding our use of your Personal Information and how you can access and update this information. This Policy does not apply to the practices of companies that we do not own or control, or to individuals that we do not employ or manage.</p>\r\n\r\n<p>Automatic collection of information</p>\r\n\r\n<p>When you visit the Website our servers automatically record information that your browser sends. This data may include information such as your device&#39;s IP address, browser type and version, operating system type and version, language preferences or the webpage you were visiting before you came to our Website, pages of our Website that you visit, the time spent on those pages, information you search for on our Website, access times and dates, and other statistics.</p>\r\n\r\n<p>Information collected automatically is used only to identify potential cases of abuse and establish statistical information regarding Website usage. This statistical information is not otherwise aggregated in such a way that would identify any particular user of the system.</p>\r\n\r\n<p>Collection of personal information</p>\r\n\r\n<p>You can visit the Website without telling us who you are or revealing any information by which someone could identify you as a specific, identifiable individual. If, however, you wish to use some of the Website&#39;s features, you will be asked to provide certain Personal Information (for example, your name and e-mail address). We receive and store any information you knowingly provide to us when you create an account, publish content, or fill any online forms on the Website. When required, this information may include the following:</p>\r\n\r\n<p>- Personal details such as name, country of residence, etc.<br />\r\n- Contact information such as email address, address, etc.<br />\r\n- Account details such as user name, unique user ID, password, etc.<br />\r\n- Any other materials you willingly submit to us such as articles, images, feedback, etc.</p>\r\n\r\n<p>You can choose not to provide us with your Personal Information, but then you may not be able to take advantage of some of the Website&#39;s features. Users who are uncertain about what information is mandatory are welcome to contact us.</p>\r\n\r\n<p>Information from Integrated Sign-On Services.</p>\r\n\r\n<p>If you decide to register through or otherwise grant access to a third-party social networking or integrated service (what we call an &ldquo;Integrated Service&rdquo;), such as Facebook, Google or similar single sign-on service, We may also collect Personal Information that is already associated with your Integrated Service account. You may also have the option of sharing additional information with us through an Integrated Service, as controlled through your settings on that Integrated Service. If you choose to provide such information, during registration or otherwise, We will treat the information as Personal Information and will use it in the ways described in this Privacy Policy.<br />\r\nWe may share anonymous or aggregate data with others.<br />\r\nWe may use data which has been de-identified and/or aggregated for product development, research, analytics and other purposes, including for the purpose of analyzing, improving, or marketing our Services. In certain occasions, we may share this data with business partners to improve our services or offerings. All data will be aggregated and/or anonym zed to reasonably avoid identification of a specific individual.</p>\r\n\r\n<p>Data security is important to you, and to us.</p>\r\n\r\n<p>To protect your privacy and security, we take reasonable steps to verify your identity before granting you account access or making corrections to your information. For example, we may ask you to provide certain Personal Information to confirm your identity, and we may require that you create and use a password to access certain parts of our Service. You should create and maintain a strong password to help ensure the security of your account.<br />\r\nWe try to ensure that our Service and information sent to us are safe, but no security measures are perfect.<br />\r\nWe use certain physical, managerial, and technical safeguards designed to preserve the integrity and security of your Personal Information and other information we maintain in connection with our Service. We cannot, however, ensure or warrant the security of any or all of the information you transmit to us, and you do so at your own risk. Once we receive your transmission of information, we make commercially reasonable efforts to ensure the security of our systems. When you enter sensitive information, we encrypt the transmission of that information using secure socket layer technology (SSL) or similar technologies. However, please note that this is not a guarantee that such information may not be accessed, disclosed, altered, or destroyed by breach of any of our physical, technical, or managerial safeguards. In the event that any information under our control is compromised as a result of a breach of security, we will take reasonable steps to investigate the situation and will notify you of the security incident in accordance with applicable laws and regulations.<br />\r\n&nbsp;<br />\r\nUsage and device information.</p>\r\n\r\n<p>To provide a personalized learning and high-quality experience for our users, we may use various technologies that automatically record certain technical information from your browser or device when you visit our website, read our emails, use our Service or otherwise engage with us. This information is typically collected through a variety of tracking technologies, including cookies, web beacons, Flash objects, log files, and similar technology (collectively, &ldquo;tracking technologies&rdquo;). These tracking technologies cookies collect information about how you use the Service (e.g., the pages you view, the links you click, and other actions you take on the Service), information about your browser and online usage patterns (e.g., Internet Protocol (&ldquo;IP&rdquo;) address, browser type, browser language, referring / exit pages and URLs, pages viewed, whether you opened an email, links clicked), and information about the device(s) you use to access the Service (e.g., mobile device identifier, mobile carrier, device type, model and manufacturer, mobile device operating system brand and model, and whether you access the Service from multiple devices). We may collect analytics data, or use third-party analytics tools such as Google Analytics, to help us measure traffic and usage trends for the Sites and to understand more about the demographics of our users. You can learn more about Google&#39;s practices at http://www.google.com/policies/privacy/partners, and view its currently available opt-out options at https://tools.google.com/dlpage/gaoptout. We may also work with third party partners to employ technologies, including the application of statistical modeling tools, which permit us to recognize and contact you across multiple devices. Although we do our best to honor the privacy preferences of our users, we are unable to respond to Do Not Track signals set by your browser at this time.<br />\r\nWe use or may use the data collected through tracking technologies to better display our website, to save you time, to provide better technical support, for promotional purposes, and to track website usage. For example, cookies help us to:<br />\r\nKeep track of whether you are signed in or have previously signed in so that we can display all the features that are available to you.<br />\r\nRemember your settings on the pages you visit, so that we can display your preferred content the next time you visit.<br />\r\nCustomize the function and appearance of the pages you visit based on information relating to your account; for example, in order to default you to a particular study level, or to remember customized settings for a report.<br />\r\nTrack website usage for various purposes including sales, marketing, and billing.<br />\r\nMost browsers are initially set up to accept cookies, but you can reset your browser to refuse all cookies or to indicate when a cookie is being sent. However, some features and services (particularly those that require you to sign-in) may not function properly if your cookies are disabled. You may also set your email options to prevent the automatic downloading of images that may contain technologies that would allow us to know whether you have accessed our email and performed certain functions with it.<br />\r\nDeleting cookies does not delete Local Storage Objects (LSOs) such as Flash objects and HTML5. You can learn more about Flash objects - including how to manage privacy and storage settings for Flash cookies &ndash; on Adobe&rsquo;s website or by clicking here. Various browsers may offer their own management tools for removing HTML5 LSOs. Please consult your browser&rsquo;s &ldquo;Help&rdquo; function to learn more. If you choose to delete Flash objects from our sites, then you may not be able to access and use all or part of the sites or benefit from the information and services offered.<br />\r\nWe and our third-party partners may also use cookies and tracking technologies for advertising purposes. For more information about tracking technologies.</p>\r\n\r\n<p>Managing personal information</p>\r\n\r\n<p>You are able to delete certain Personal Information we have about you. The Personal Information you can delete may change as the Website or Services change. When you delete Personal Information, however, we may maintain a copy of the unrevised Personal Information in our records for the duration necessary to comply with our obligations to our affiliates and partners, and for the purposes described below.</p>\r\n\r\n<p>Storing personal information</p>\r\n\r\n<p>We will retain and use your Personal Information for the period necessary to comply with our legal obligations, resolve disputes, and enforce our agreements unless a longer retention period is required or permitted by law. We may use any aggregated data derived from or incorporating your Personal Information after you update or delete it, but not in a manner that would identify you personally. Once the retention period expires, Personal Information shall be deleted. Therefore, the right to access, the right to erasure, the right to rectification and the right to data portability cannot be enforced after the expiration of the retention period.</p>\r\n\r\n<p>Use and processing of collected information</p>\r\n\r\n<p>In order to make our Website and Services available to you, or to meet a legal obligation, we need to collect and use certain Personal Information. If you do not provide the information that we request, we may not be able to provide you with the requested products or services. Some of the information we collect is directly from you via our Website. However, we may also collect Personal Information about you from other sources. Any of the information we collect from you may be used for the following purposes:</p>\r\n\r\n<p>- Create and manage user accounts<br />\r\n- Send administrative information<br />\r\n- Respond to inquiries and offer support<br />\r\n- Request user feedback<br />\r\n- Improve user experience<br />\r\n- Administer prize draws and competitions<br />\r\n- Enforce terms and conditions and policies<br />\r\n- Protect from abuse and malicious users<br />\r\n- Respond to legal requests and prevent harm<br />\r\n- Run and operate our Website and Services</p>\r\n\r\n<p>Processing your Personal Information depends on how you interact with our Website, where you are located in the world and if one of the following applies: (i) You have given your consent for one or more specific purposes. This, however, does not apply, whenever the processing of Personal Information is subject to&nbsp; protection law; (ii) Provision of information is necessary for the performance of an agreement with you and/or for any pre-contractual obligations thereof; (iii) Processing is necessary for compliance with a legal obligation to which you are subject; (iv) Processing is related to a task that is carried out in the public interest or in the exercise of official authority vested in us; (v) Processing is necessary for the purposes of the legitimate interests pursued by us or by a third party.</p>\r\n\r\n<p>&nbsp;Note that under some legislations we may be allowed to process information until you object to such processing (by opting out), without having to rely on consent or any other of the following legal bases below. In any case, we will be happy to clarify the specific legal basis that applies to the processing, and in particular whether the provision of Personal Information is a statutory or contractual requirement, or a requirement necessary to enter into a contract.</p>\r\n\r\n<p>The rights of users</p>\r\n\r\n<p>You may exercise certain rights regarding your information processed by us. In particular, you have the right to do the following: (i) you have the right to withdraw consent where you have previously given your consent to the processing of your information; (ii) you have the right to object to the processing of your information if the processing is carried out on a legal basis other than consent; (iii) you have the right to learn if information is being processed by us, obtain disclosure regarding certain aspects of the processing and obtain a copy of the information undergoing processing; (iv) you have the right to verify the accuracy of your information and ask for it to be updated or corrected; (v) you have the right, under certain circumstances, to restrict the processing of your information, in which case, we will not process your information for any purpose other than storing it; (vi) you have the right, under certain circumstances, to obtain the erasure of your Personal Information from us; (vii) you have the right to receive your information in a structured, commonly used and machine readable format and, if technically feasible, to have it transmitted to another controller without any hindrance. This provision is applicable provided that your information is processed by automated means and that the processing is based on your consent, on a contract which you are part of or on pre-contractual obligations thereof.</p>\r\n\r\n<p><br />\r\nCookies</p>\r\n\r\n<p>The Website uses &quot;cookies&quot; to help personalize your online experience. A cookie is a text file that is placed on your hard disk by a web page server. Cookies cannot be used to run programs or deliver viruses to your computer. Cookies are uniquely assigned to you, and can only be read by a web server in the domain that issued the cookie to you.</p>\r\n\r\n<p>We may use cookies to collect, store, and track information for statistical purposes to operate our Website and Services. You have the ability to accept or decline cookies. Most web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies if you prefer. If you choose to decline cookies, you will not be able to use and experience the features of the Website and Services. To learn more about cookies and how to manage them, visit internetcookies.org</p>\r\n\r\n<p>Do Not Track signals</p>\r\n\r\n<p>Some browsers incorporate a Do Not Track feature that signals to websites you visit that you do not want to have your online activity tracked. Tracking is not the same as using or collecting information in connection with a website. For these purposes, tracking refers to collecting personally identifiable information from consumers who use or visit a website or online service as they move across different websites over time. How browsers communicate the Do Not Track signal is not yet uniform. As a result, this Website is not yet set up to interpret or respond to Do Not Track signals communicated by your browser. Even so, as described in more detail throughout this Policy, we limit our use and collection of your personal information.</p>\r\n\r\n<p>Links to other websites</p>\r\n\r\n<p>Our Website contains links to other websites that are not owned or controlled by us. Please be aware that we are not responsible for the privacy practices of such other websites or third-parties. We encourage you to be aware when you leave our Website and to read the privacy statements of each and every website that may collect Personal Information.</p>\r\n\r\n<p>Information security</p>\r\n\r\n<p>We secure information you provide on computer servers in a controlled, secure environment, protected from unauthorized access, use, or disclosure. We maintain reasonable administrative, technical, and physical safeguards in an effort to protect against unauthorized access, use, modification, and disclosure of Personal Information in its control and custody. However, no data transmission over the Internet or wireless network can be guaranteed. Therefore, while we strive to protect your Personal Information, you acknowledge that (i) there are security and privacy limitations of the Internet which are beyond our control; (ii) the security, integrity, and privacy of any and all information and data exchanged between you and our Website cannot be guaranteed; and (iii) any such information and data may be viewed or tampered with in transit by a third-party, despite best efforts.</p>\r\n\r\n<p>Data breach</p>\r\n\r\n<p>In the event we become aware that the security of the Website has been compromised or users Personal Information has been disclosed to unrelated third parties as a result of external activity, including, but not limited to, security attacks or fraud, we reserve the right to take reasonably appropriate measures, including, but not limited to, investigation and reporting, as well as notification to and cooperation with law enforcement authorities. In the event of a data breach, we will make reasonable efforts to notify affected individuals if we believe that there is a reasonable risk of harm to the user as a result of the breach or if notice is otherwise required by law. When we do, we will post a notice on the Website.</p>\r\n\r\n<p><strong>Legal disclosure</strong></p>\r\n\r\n<p>We will disclose any information we collect, use or receive if required or permitted by law, such as to comply with a subpoena, or similar legal process, and when we believe in good faith that disclosure is necessary to protect our rights, protect your safety or the safety of others, investigate fraud, or respond to a government request.</p>\r\n\r\n<p><strong>Changes and amendments</strong></p>\r\n\r\n<p>We may update this Privacy Policy from time to time in our discretion and will notify you of any material changes to the way in which we treat Personal Information. When changes are made, we will revise the updated date at the bottom of this page. We may also provide notice to you in other ways in our discretion, such as through contact information you have provided. Any updated version of this Privacy Policy will be effective immediately upon the posting of the revised Privacy Policy unless otherwise specified. Your continued use of the Website or Services after the effective date of the revised Privacy Policy (or such other act specified at that time) will constitute your consent to those changes. However, we will not, without your consent, use your Personal Data in a manner materially different than what was stated at the time your Personal Data was collected.</p>\r\n\r\n<p><strong>Acceptance of this policy</strong></p>\r\n\r\n<p>You acknowledge that you have read this Policy and agree to all its terms and conditions. By using the Website or its Services you agree to be bound by this Policy. If you do not agree to abide by the terms of this Policy, you are not authorized to use or access the Website and its Services.</p>\r\n\r\n<p><strong>Contacting us</strong></p>\r\n\r\n<p><strong>Sahardirectory </strong>is a part of <strong>Ekaum Enterprises</strong>.</p>\r\n\r\n<p>If you would like to contact us to understand more about this Policy or wish to contact us concerning any matter relating to individual rights and your Personal Information, you may send an email to contact@sahardirectory.com</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2020-12-26 08:24:25');
