r user account for commercial, marketing or any similar purpose. But you grant us permission to access, copy, distribute, store, transmit, reformat, display and perform the Content of your user account solely as required for the purpose of providing the Services to you. Without limiting any of those representations or warranties, we have the right, though not the obligation, to, in our own sole discretion, refuse or remove any Content that, in our reasonable opinion, violates any of our policies or is in any way harmful or objectionable.</p>\r\n\r\n<p><strong>Submissions</strong></p>\r\n\r\n<p>You retain copyright You already hold in Content which You submit, post or display on or through, the Services. By submitting, posting or displaying the Content You give us and our affiliated companies, sublicensees (including third parties whose products, technologies and services use or interface with any specific parts of our software or service that includes the Content) and other Users of the Website, a perpetual, irrevocable, transferable, worldwide, royalty-free, and non-exclusive license to reproduce, adapt, modify, translate, publish, publicly perform, publicly display and distribute any Content which You submit, post or display on or through, the Website. You will not provide any Content that is subject to a license that requires us to license our software or documentation to third parties because we include Your Content in them.<br />\r\nWe are under no obligation to post or use any Content You may provide, and we may remove any Content at any time in its sole discretion. By Posting Content You warrant and represent that You have all the rights, power and authority necessary to grant the above licensee.<br />\r\n&nbsp;<br />\r\n<strong>Software</strong></p>\r\n\r\n<p>All Software which may be available to be downloaded from the Website (the &ldquo;Software&rdquo;) is the copyrighted work us and/or third party providers. Use of the Software is governed by the terms o