tent jurisdiction, it is the intention of the parties that the remaining provisions or portions thereof shall constitute their agreement with respect to the subject matter hereof, and all such remaining provisions or portions thereof shall remain in full force and effect.</p>\r\n\r\n<p><strong>Dispute resolution</strong></p>\r\n\r\n<p>The formation, interpretation, and performance of this Agreement and any disputes arising out of it shall be governed by the substantive and procedural laws of Rajasthan, India without regard to its rules on conflicts or choice of law and, to the extent applicable, the laws of India. The exclusive jurisdiction and venue for actions related to the subject matter hereof shall be the courts located within the city of Rewari, Haryana, India, and you hereby submit to the personal jurisdiction of such courts. You hereby waive any right to a jury trial in any proceeding arising out of or related to this Agreement.</p>\r\n\r\n<p><strong>General</strong></p>\r\n\r\n<p>The Terms constitute the whole legal agreement between You and us governs Your use of the Website (but excluding any services which we may provide to You under a separate written agreement), and completely replace any prior agreements between You and us in relation to the Website. You agree that we may provide You with notices, including those regarding changes to the Terms, by email, regular mail, or postings on the Website. You agree that if we do not exercise or enforce any legal right or remedy which is contained in the Terms (or which we have the benefit of under any applicable law), this will not be taken to be a formal waiver of our rights and that those rights or remedies will still be available to us.<br />\r\nIf any court of law, having the jurisdiction to decide on this matter, rules that any provision of these Terms is invalid, then that provision will be removed from the Terms without affecting the rest of the Terms. The remaining provisions of the Terms will continue